// This file contains a speedy lookup table of first 20000 primes, as required by the message
// stretching function of RatHash that increases the length of small message inputs in a seemingly
// random way.

//go:noinline
func load(val string) *big.Int {
	pointer, _ := new(big.Int).SetString(val, 16)
	if pointer == nil {
		panic("invalid cache member: " + val)
	}
	return pointer
}

